import React from 'react'
import styled from 'styled-components'
import el from './imagens/011.jpg'

const Eleven = styled.img`
width: 300px;
`

export default function Post(fotoPost) {
  return (
    <div>
       <Eleven src = {el}/>
    </div>
  )
}
